import { Container, Row, Col } from 'react-bootstrap';
import "./header.css";

export default function Header() {
  return (
    <Container fluid>
      <Row>
        <Col className="algin-left"><img alt="icon" src="../uf.png" width="60" height="60" /></Col>
        <Col className="algin-left margin-top" xs={11}><h2>FLORIDA TRAFFIC CRASHES DASHBOARD</h2></Col>
      </Row>
    </Container>
  );
}
